import logo from './logo.svg';
import './App.css';

function App() {
  const axios = require('axios');
  const FormData = require('form-data');
  let data = new FormData();
  data.append('id', '0');
  data.append('name', 'computer');

  let config = {
    method: 'post',
    maxBodyLength: Infinity,
    url: 'https://virtserver.swaggerhub.com/KOUPTCHINSKYNG/test/1.0.1/category',
    headers: { 
      ...data.getHeaders()
    },
    data : data
  };

  axios.request(config)
  .then((response) => {
    console.log(JSON.stringify(response.data));
  })
  .catch((error) => {
    console.log(error);
  });
  return (
    <div className="App">

    </div>
  );
}

export default App;
